description:
DaWicksta is the stage name of David Cortez (May 13, 1975— ), a recording engineer, recording artist, producer and graphic designer. He was born in Watts, Los Angeles, California. He grew up throughout the Los Angeles areas Compton and Lynwood. He spent some years in Pasadena in a foster home, then later in teen years, lived with his father and younger sibling in the San Bernardino area. When his father died, Wick then 16 years old moved to Stockton, California to live with relatives. It was then that he really began taking music as more than just a pastime. He began booking studio time and recording songs. In 1995 after spending a couple of years in the California Conservation Corps CCC out of Camarillo, CA, Wick moved down to San Diego, CA, where he attended college recording classes. While attending school, he also landed an internship at Studio West. At Mesa College he met the other two members of the hip hop trio, the Roundtable MCs. After years of performing, touring and recording with the Roundtable MCs, Wick returned to Los Angeles to put his stamp on the music industry and get to know what it truly is all about at the mainstream level. He has served as a recording engineer for Brandy, Amanda Perez, Brooke Valentine, Greg Ginn, W.C. and Play-n-Skillz among others. DaWicksta now resides wherever and continues to releases Ultra-Independent HipHop Music via da interwebz.

